(0, 244, 103, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>Etiam nec metus. Proin mauris lorem, lobortis dapibus, semper id, nonummy eu, lacus.\n                            Aliquam erat volutpat. Vivamus hendrerit aliquam ipsum. Maecenas suscipit ante sit amet\n                            risus. Nullam lacus. Praesent varius imperdiet sapien. Nulla sit amet massa nonummy felis\n                            aliquam varius. Vivamus sed arcu. Mauris sodales tristique risus. Cras sed sem. Quisque est\n                            eros, lacinia id, placerat sit amet, varius ac, odio. Aenean placerat, justo eu laoreet\n                            laoreet, purus quam faucibus risus, vel accumsan mauris ligula in magna.\n                        </paragraph></section>', 'ezxmltext', 548, 'fre-FR', 2, 0, '', 1),
