(0, 186, 105, 0, 1045487555, '<?xml version="1.0"?>\n<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><table class="default" width="100%" border="0" custom:summary="tutorials"><tr><td><paragraph align="left"><strong><strong>new to eZ Publish users</strong></strong></paragraph></td><td><paragraph align="left"><strong>experienced users</strong></paragraph></td></tr><tr><td align="center"/><td align="center"/></tr><tr><td><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><embed view="embed-inline" size="medium" custom:offset="0" custom:limit="5" object_id="107"/></paragraph></td><td><paragraph><link target="_blank" url_id="16">\n                                                How to develop eZ Publish Extensions\n                                            </link></paragraph></td></tr><tr><td><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><embed view="embed-inline" size="medium" custom:offset="0" custom:limit="5" object_id="187"/></paragraph></td><td><paragraph><link target="_blank" xhtml:id="internal-source-marker_0.15448186383582652" url_id="17">\n                                                How to create custom workflow\n                                            </link></paragraph></td></tr><tr><td><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><embed view="embed-inline" size="medium" custom:offset="0" custom:limit="5" object_id="126"/></paragraph></td><td><paragraph><link target="_blank" url_id="18">\n                                                How to use REST API interface\n                                            </link></paragraph></td></tr><tr><td><paragraph><link target="_blank" xhtml:id="internal-source-marker_0.15448186383582652" url_id="13">\n                                              