(0, 186, 106, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph><link target="_blank" xhtml:id="internal-source-marker_0.15448186383582652" url_id="26">Forums</link>,&amp;nbsp;<link target="_blank" url_id="27">\n                            Blogs</link>,&amp;nbsp;<link target="_blank" url_id="28">\n                            Twitter</link>,&amp;nbsp;\n                            <link target="_blank" url_id="29">LinkedIn</link></paragraph></section>', 'ezxmltext', 573, 'fre-FR', 2, 0, '', 1);
INSERT INTO `ezcontentobject_attribute` (`attribute_original_id`, `contentclassattribute_id`, `contentobject_id`, `data_float`, `data_int`, `data_text`, `data_type_string`, `id`, `language_code`, `language_id`, `sort_key_int`, `sort_key_string`, `version`) VALUES
(0, 187, 106, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>[<link target="_self" anchor_name="contact" url_id="30">contact</link>] [<link target="_self" anchor_name="share" url_id="30">\n                            share</link>] [<link target="_self" anchor_name="develop" url_id="30">develop</link>]\n                        </paragraph><paragraph>If you want to get involved in the eZ Community''s life, help, be helped, share and\n                            participate, this page is for you. It gives you a list of hints and tricks on how to\n                            actually get involved.\n                        </paragraph><paragraph>Make sure you also read the&amp;nbsp;\n                            <link target="_self" url_id="31">Etiquette,\n                                blogging and usage guidelines\n                            </link>\n                        </paragraph><paragraph><anchor name="contact"/></paragraph><paragraph><anchor name="eztoc772_1"/></paragraph><paragraph><anchor name="eztoc1010_1_1"/></paragraph><paragraph><anchor name="eztoc1031_0_1_1"/></paragraph><section><section><section><section><header>Contact</header><paragraph>Should anything be unclear ( after having read through the following\n                                            :) ), or if you would like to ask a question, feel free to send an email to\n                                            community@ez.no.\n                                        </paragraph><paragraph><anchor name="share"/></paragraph><paragraph><anchor name="eztoc772_2"/></paragraph><paragraph><anchor name="eztoc1010_1_2"/></paragraph><paragraph><anchor name="eztoc1031_0_1_2"/></paragraph></section></section></section></section><section><section><section><section><header>Sharing</header><paragraph><anchor name="eztoc772_2_1"/></paragraph><paragraph><anchor name="eztoc1010_1_2_1"/></paragraph><paragraph><anchor name="eztoc1031_0_1_2_1"/></paragraph><section><header>Forums</header><paragraph>From&amp;nbsp;<link target="_self" xhtml:title="eZ Community forums" url_id="26">\n                                                http://share.ez.no/forums</link>, you can pick one of the existing\n                                                forums and ask a question, make a remark, answers others'' questions, or\n                                                simply read through, looking for a bit of information. The following\n                                                forums are available:\n                                            </paragraph><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link target="_self" url_id="32">\n                                                                Install &amp; configuration</link>&amp;nbsp;(<link target="_self" anchor_name="RSS" url_id="30">rss</link>)\n                                                        </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link target="_self" url_id="33">Setup\n                                                                &amp; design</link>&amp;nbsp;(<link target="_self" anchor_name="RSS" url_id="30">\n                                                            rss</link>)\n                                                        </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link target="_self" url_id="34">\n                                                                General</link>&amp;nbsp;(<link target="_self" anchor_name="RSS" url_id="30">\n                                                            rss</link>)\n                                                        </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link target="_self" url_id="35">\n                                                                Developer</link>&amp;nbsp;(<link target="_self" anchor_name="RSS" url_id="30">\n                                                            rss</link>)\n                                                        </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link target="_self" url_id="36">\n                                                                Suggestions</link>&amp;nbsp;(<link target="_self" anchor_name="RSS" url_id="30">\n                                                            rss</link>)\n                                                        </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link target="_self" url_id="37">\n                                                                Extensions</link>&amp;nbsp;(<link target="_self" anchor_name="RSS" url_id="30">\n                                                            rss</link>)\n                                                        </paragraph></li></ul></paragraph><paragraph>The "Extensions" forum is broken down into extension-specific\n                                                subforums:\n                                            </paragraph><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link target="_self" url_id="38">\n                                                                eZ Newsletter</link>&amp;nbsp;(<link target="_self" anchor_name="RSS" url_id="30">\n                                                            rss</link>)\n                                                        </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link target="_self" url_id="39">\n                                                                Website Interface</link>&amp;nbsp;(<link target="_self" anchor_name="RSS" url_id="30">\n                                                            rss</link>)\n                                                        </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link target="_self" url_id="40">eZ\n                                                                Flow</link>&amp;nbsp;(<link target="_self" anchor_name="RSS" url_id="30">\n                                                            rss</link>)\n                                                        </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link target="_self" url_id="41">eZ\n                                                                Find</link>&amp;nbsp;(<link target="_self" anchor_name="RSS" url_id="30">\n                                                            rss</link>)\n                                                        </paragraph></li></ul></paragraph><paragraph>One forum is dedicated to translators and linguists translating\n                                                eZ Publish :\n                                            </paragraph><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link target="_self" xhtml:title="Forum dedicated to translators" url_id="42">\n                                                                Translations</link>&amp;nbsp;(<link target="_self" anchor_name="RSS" url_id="30">\n                                                            rss</link>)\n                                                        </paragraph></li></ul></paragraph><paragraph>One forum is dedicated to local eZ Publish communities who do not\n                                                have a dedicated platform and would like to share in their native\n                                                language :\n                                            </paragraph><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link target="_self" xhtml:title="Localized forums" url_id="43">\n                                                                Localized forums</link>&amp;nbsp;(<link target="_self" anchor_name="RSS" url_id="30">\n                                                            rss</link>)\n                                                        </paragraph></li></ul></paragraph><paragraph>A last forum welcomes suggestions for this portal:</paragraph><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link target="_self" url_id="44">\n                                                                Feedback and ideas for this portal</link>&amp;nbsp;(\n                                                            <link target="_self" anchor_name="RSS" url_id="30">\n                                                                rss</link>)\n                                                        </paragraph></li></ul></paragraph><paragraph>It is often used in conjunction with the&amp;nbsp;<link target="_blank" xhtml:title="Issue tracker for the Community Portal" url_id="45">\n                                                share.ez.no-dedicated issue tracker</link>&amp;nbsp;(not to be confused\n                                                with the&amp;nbsp;<link target="_blank" xhtml:title="General eZ Publish issue tracker" url_id="46">\n                                                    general eZ Publish issue tracker</link>).\n                                            </paragraph><paragraph>&amp;nbsp;\n                                                <anchor name="eztoc772_2_2"/>\n                                            </paragraph><paragraph><anchor name="eztoc1010_1_2_2"/></paragraph><paragraph><anchor name="eztoc1031_0_1_2_2"/></paragraph></section><section><header>Your experience through an article or tutorial</header><paragraph>The&amp;nbsp;<link target="_self" xhtml:title="eZ Community Articles" url_id="47">\n                                                Articles</link>&amp;nbsp;and&amp;nbsp;<link target="_self" xhtml:title="eZ Community Tutorials" url_id="48">\n                                                Tutorials</link>&amp;nbsp;sections are gold mines of useful, practical\n                                                information on eZ Publish and eZ Software usage. You may be willing to\n                                                contribute to growing the amount of common gold by sharing one of your\n                                                experiences, right here. Read more on this here :<link target="_self" url_id="49">\n                                                    Share your experience, write a tutorial for the Community</link>.\n                                            </paragraph><paragraph><anchor name="IRC"/></paragraph><paragraph>&amp;nbsp;\n                                                <anchor name="eztoc772_2_3"/>\n                                            </paragraph><paragraph><anchor name="eztoc1010_1_2_3"/></paragraph><paragraph><anchor name="eztoc1031_0_1_2_3"/></paragraph></section><section><header>Live chat on IRC</header><paragraph>Two channels are dedicated to live chat (mostly around eZ Publish\n                                                and eZ Components), here they are :\n                                            </paragraph><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">\n                                                            eZ Publish room:&amp;nbsp;\n                                                            <link target="_self" anchor_name="ezpublish" url_id="50">\n                                                                irc://irc.freenode.net/#ezpublish\n                                                            </link>\n                                                        </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">\n                                                            eZ Components room:&amp;nbsp;\n                                                            <link target="_self" anchor_name="zetacomponents" url_id="50">\n                                                                irc://irc.freenode.net/#zetacomponents\n                                                            </link>\n                                                        </paragraph></li></ul></paragraph><paragraph><line xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Feel\n                                                    free and join the chat. Usually there is a number of people willing\n                                                    to help you out with your problem or discuss features.&amp;nbsp;\n                                                </line><line xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">You need\n                                                    an&amp;nbsp;<link target="_self" anchor_name="Clients" url_id="51">\n                                                        IRC Client</link>&amp;nbsp;for joining the channel. Here is an\n                                                    indicative list of popular IRC clients :\n                                                </line></paragraph><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link target="_self" url_id="52">XChat\n                                                            </link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link target="_self" url_id="53">mIRC</link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link target="_self" url_id="54">Pidgin\n                                                            </link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link target="_self" url_id="55">Colloquy\n                                                            </link></paragraph></li></ul></paragraph><paragraph>&amp;nbsp;\n                                                <anchor name="eztoc772_2_4"/>\n                                            </paragraph><paragraph><anchor name="eztoc1010_1_2_4"/></paragraph><paragraph><anchor name="eztoc1031_0_1_2_4"/></paragraph></section><section><header>Blogging</header><paragraph><line xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">A\n                                                    central blog planet is aggregating many community members'' blogs:\n                                                    <link target="_blank" xhtml:title="Planet eZ Publish" url_id="56">\n                                                        http://planetezpublish.org/</link>&amp;nbsp;(available through&amp;nbsp;\n                                                    <link target="_blank" xhtml:title="planetezpublish RSS feed" url_id="57">\n                                                        RSS</link>&amp;nbsp;).\n                                                </line><line xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Local\n                                                    initiatives exists, among them the french-speaking blog-planet :&amp;nbsp;\n                                                    <link target="_blank" xhtml:title="French eZ Publish blog planet" url_id="58">\n                                                        http://www.planet-ezpublish.fr/</link>.\n                                                </line></paragraph><paragraph>Atop, this platform will soon open to public blogging, stay\n                                                tuned.\n                                            </paragraph><paragraph>&amp;nbsp;\n                                                <anchor name="eztoc772_2_5"/>\n                                            </paragraph><paragraph><anchor name="eztoc1010_1_2_5"/></paragraph><paragraph><anchor name="eztoc1031_0_1_2_5"/></paragraph></section><section><header>Mailing-lists</header><paragraph>Feel free to register on the eZ Community mailing-list. You can\n                                                do so here :<link target="_blank" xhtml:title="eZ Community mailing-list" url_id="59">\n                                                    http://lists.ez.no/mailman/listinfo/sdk-public</link>. It serves as\n                                                a community support channel, obviously less responsive than IRC or\n                                                twitter, but more persistent, which can be preferred in some cases.\n                                            </paragraph><paragraph>Another mailing-list helps you see pass by every commit messages\n                                                on eZ Publish''s development trunk. If you are eager to see one specific\n                                                feature implemented, or simply like to be updated with the\n                                                bleeding-edge, vip status of eZ Publish, you should subscribe to that\n                                                one :&amp;nbsp;\n                                                <link target="_blank" url_id="60">\n                                                    http://lists.ez.no/mailman/listinfo/sdk-svn\n                                                </link>\n                                            </paragraph><paragraph>&amp;nbsp;\n                                                <anchor name="eztoc772_2_6"/>\n                                            </paragraph><paragraph><anchor name="eztoc1010_1_2_6"/></paragraph><paragraph><anchor name="eztoc1031_0_1_2_6"/></paragraph></section><section><header>RSS</header><paragraph><anchor name="RSS"/></paragraph><paragraph>Follow the eZ Community activity through RSS. Here are the feeds\n                                                at your disposal:\n                                            </paragraph><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">\n                                                            All forums (topics &amp; replies):&amp;nbsp;\n                                                            <link target="_self" url_id="61">\n                                                                http://share.ez.no/rss/feed/all_forums\n                                                            </link>\n                                                        </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">\n                                                            Forum topics ONLY :&amp;nbsp;\n                                                            <link target="_self" xhtml:title="RSS feed for forum topics ONLY" url_id="62">\n                                                                http://share.ez.no/rss/feed/forum_topics_only\n                                                            </link>\n                                                        </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">\n                                                            Articles and Tutorials :&amp;nbsp;\n                                                            <link target="_self" url_id="63">\n                                                                http://share.ez.no/rss/feed/articles\n                                                            </link>\n                                                        </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">\n                                                            Blogs :&amp;nbsp;\n                                                            <link target="_self" url_id="64">\n                                                                http://share.ez.no/rss/feed/blogs\n                                                            </link>\n                                                        </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">\n                                                            Forums &gt; Developer :&amp;nbsp;\n                                                            <link target="_self" url_id="65">\n                                                                http://share.ez.no/rss/feed/forums_developer\n                                                            </link>\n                                                        </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">\n                                                            Forums &gt; Discussions :&amp;nbsp;\n                                                            <link target="_self" url_id="66">\n                                                                http://share.ez.no/rss/feed/forums_discussions\n                                                            </link>\n                                                        </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">\n                                                            Forums &gt; Extensions :&amp;nbsp;\n                                                            <link target="_self" url_id="67">\n                                                                http://share.ez.no/rss/feed/forums_extensions\n                                                            </link>\n                                                        </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">\n                                                            Forums &gt; Feedback :&amp;nbsp;\n                                                            <link target="_self" url_id="68">\n                                                                http://share.ez.no/rss/feed/forums_feedback\n                                                            </link>\n                                                        </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">\n                                                            Forums &gt; General :&amp;nbsp;\n                                                            <link target="_self" url_id="69">\n                                                                http://share.ez.no/rss/feed/forums_general\n                                                            </link>\n                                                        </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">\n                                                            Forums &gt; Install and Configuration :\n                                                            <link target="_self" url_id="70">\n                                                                http://share.ez.no/rss/feed/forums_install_and_configuration\n                                                            </link>\n                                                        </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">\n                                                            Forums &gt; Setup and Design :&amp;nbsp;\n                                                            <link target="_self" url_id="71">\n                                                                http://share.ez.no/rss/feed/forums_setup_and_design\n                                                            </link>\n                                                        </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">\n                                                            Forums &gt; Suggestions :&amp;nbsp;\n                                                            <link target="_self" url_id="72">\n                                                                http://share.ez.no/rss/feed/forums_suggestions\n                                                            </link>\n                                                        </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">\n                                                            Forums &gt; Translation :&amp;nbsp;\n                                                            <link target="_self" xhtml:title="Translation related forum" url_id="73">\n                                                                http://share.ez.no/rss/feed/forums_translation\n                                                            </link>\n                                                        </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">\n                                                            Projects :&amp;nbsp;\n                                                            <link target="_self" url_id="74">\n                                                                http://share.ez.no/rss/feed/projects\n                                                            </link>\n                                                        </paragraph></li></ul></paragraph><paragraph>&amp;nbsp;\n                                                <anchor name="eztoc772_2_7"/>\n                                            </paragraph><paragraph><anchor name="eztoc1010_1_2_7"/></paragraph><paragraph><anchor name="eztoc1031_0_1_2_7"/></paragraph></section><section><header>Social networks</header><paragraph>Stay tuned on the portal''s activity by following&amp;nbsp;<link target="_blank" xhtml:title="eZ Publish Community on twitter" url_id="28">@ezcommunity</link>. Also,\n                                                cool instant pings happen on Twitter, where many community members are\n                                                active. Feel free to join this sphere, and the first step could be to\n                                                follow this Twitter list :&amp;nbsp;<link target="_blank" xhtml:title="eZ Community members on Twitter" url_id="75">\n                                                    http://twitter.com/i_robin/cms-ezpublish/members</link>.\n                                            </paragraph><paragraph>The eZ Publish Community is also gathered on LinkedIn, swing by&amp;nbsp;\n                                                <link target="_blank" xhtml:title="eZ Ecosystem on LinkedIn" url_id="29">there</link>!\n                                            </paragraph><paragraph>Some&amp;nbsp;<link target="_blank" xhtml:title="Google Wave" url_id="76">Waves</link>\n                                                &amp;nbsp;also got attention from the community members. One way to see\n                                                them is to search, from Google Wave, the following: "with:public\n                                                ezpublish". So come by and wave on with us. In case you need an\n                                                invitation, drop a word here :<link target="_self" url_id="77">\n                                                    http://share.ez.no/forums/general/ez-publish-on-google-wave</link>.\n                                            </paragraph><paragraph><anchor name="develop"/>[<link target="_self" xhtml:title="Back to top" anchor_name="top" url_id="30">\n                                                back to top</link>]\n                                            </paragraph><paragraph><anchor name="eztoc772_3"/></paragraph><paragraph><anchor name="eztoc1010_1_3"/></paragraph><paragraph><anchor name="eztoc1031_0_1_3"/></paragraph></section></section></section></section></section><section><section><section><section><header>Developing</header><paragraph><anchor name="eztoc772_3_8"/></paragraph><paragraph><anchor name="eztoc1010_1_3_8"/></paragraph><paragraph><anchor name="eztoc1031_0_1_3_8"/></paragraph><section><header>Collaborative development</header><paragraph>You have developed a cool extension for eZ Publish ? You would\n                                                like to share it, and get other community members to help you push it\n                                                ahead ? Then you should visit<link target="_blank" xhtml:title="eZ Community projects" url_id="78">\n                                                    http://projects.ez.no</link>&amp;nbsp;and open-source it there. You\n                                                can log in with your ez.no account (the same as your share.ez.no\n                                                account), and create a new project there. You may want to first check\n                                                that no similar extension already exists, in which case you would\n                                                probably prefer joining the existing team and tell about your ideas,\n                                                suggestions and already crafted code.\n                                            </paragraph><paragraph>This platform gives every project a simple collaborative\n                                                development sandbox:\n                                            </paragraph><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">\n                                                            forums\n                                                        </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">\n                                                            a subversion repository\n                                                        </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">\n                                                            a news wall\n                                                        </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">\n                                                            a home page\n                                                        </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">\n                                                            a rating system for people to praise or blame\n                                                        </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">\n                                                            galleries for screenshots\n                                                        </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">\n                                                            a download section\n                                                        </paragraph></li></ul></paragraph><paragraph><anchor name="doc"/></paragraph><paragraph><anchor name="eztoc772_3_9"/></paragraph><paragraph><anchor name="eztoc1010_1_3_9"/></paragraph><paragraph><anchor name="eztoc1031_0_1_3_9"/></paragraph></section><section><header>Documentation</header><paragraph>Online documentation helps you in your daily development and\n                                                administration tasks. The official documentation for eZ Publish is\n                                                available at&amp;nbsp;<link target="_blank" xhtml:title="eZ Publish documentation" url_id="9">\n                                                    http://doc.ez.no</link>. A community initiative,<link target="_blank" xhtml:title="ez Publish community documentation" url_id="79">http://ezpedia.org</link>, comes as a\n                                                relevant and handy knowledge base, very complimentary to the online\n                                                documentation. The eZ Publish API documentation is&amp;nbsp;<link target="_blank" xhtml:title="eZ Publish API documentation" url_id="80">\n                                                    here</link>, and the official documentation for the Apache Zeta\n                                                Components (formerly known as eZ Components) lies<link target="_blank" xhtml:title="Apache Zeta Components" url_id="81">\n                                                    here</link>. The Apache Zeta Components serve nowadays, in many\n                                                places, as base libraries for eZ Publish, and are a generally\n                                                high-quality set of libraries for web application development.\n                                            </paragraph><paragraph>&amp;nbsp;\n                                                <anchor name="eztoc772_3_10"/>\n                                            </paragraph><paragraph><anchor name="eztoc1010_1_3_10"/></paragraph><paragraph><anchor name="eztoc1031_0_1_3_10"/></paragraph></section><section><header>Trunk, testing and sending feedback</header><paragraph><line xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">For\n                                                    every eZ Publish release, the usual alpha-beta-rc countdown should\n                                                    happen, and the eZ Community will be in first line to check these\n                                                    pre-release versions of eZ Publish Community Project and push\n                                                    feedback on them.\n                                                </line><line xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">On top\n                                                    of these regular fevers, on a daily basis you may want to report\n                                                    issues found on eZ Publish, as well as propose enhancements. And\n                                                    this happens here :<link target="_blank" xhtml:title="eZ Publish general issue tracker" url_id="82">\n                                                        http://issues.ez.no/ezpublish</link>.\n                                                </line></paragraph><paragraph>You can as well follow every step of eZ Publish''s development by\n                                                checking out the trunk version of it. It is hosted on a Github server.\n                                                All you need is to visit&amp;nbsp;<link target="_blank" xhtml:title="eZ Publish Community Project''s github repository" url_id="83">\n                                                    eZ Publish Community Project''s github repository</link>, and enjoy\n                                                :)\n                                            </paragraph><paragraph>&amp;nbsp;\n                                                <anchor name="eztoc772_3_11"/>\n                                            </paragraph><paragraph><anchor name="eztoc1010_1_3_11"/></paragraph><paragraph><anchor name="eztoc1031_0_1_3_11"/></paragraph></section><section><header>Translation and localisation</header><paragraph>A central community translation initiative is hosted here<link target="_blank" xhtml:title="Community Translation Initiative" url_id="84">\n                                                http://projects.ez.no/ezpublish_translation</link>. The homepage of the\n                                                project gives you all necessary details to get involved in translating\n                                                eZ Publish into your preferred language. If you feel you have a linguist\n                                                soul, or simply are fed up with not being able to use eZ Publish in your\n                                                native language, this initiative is for you!\n                                            </paragraph></section></section></section></section></section></section>', 'ezxmltext', 574, 'fre-FR', 2, 0, '', 1),
