(0, 186, 107, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>eZ Publish comes with a multitude of features out of the box, ensuring that you can\n                            quickly put your content online.\n                        </paragraph></section>', 'ezxmltext', 585, 'fre-FR', 2, 0, '', 1),
(0, 187, 107, 0, 1045487555, '<?xml version="1.0"?>\n<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Publish content\n                                        from your web browser\n                                    </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Publish content\n                                        from word processors\n                                    </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Translate your\n                                        content\n                                    </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Upload multiple\n                                        files at once\n                                    </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Picture\n                                        galleries\n                                    </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Video\n                                        publishing\n                                    </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Web 2.0\n                                        features\n                                    </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Search\n                                    </paragraph></li></ul></paragraph><section><section><header>Publish content from your web browser</header><paragraph><embed align="center" view="embed-inline" size="original" custom:offset="0" custom:limit="5" object_id="108"/></paragraph><paragraph>With eZ Publish, you can publish content like articles, pictures and files\n                                    directly from your web browser, using the Website Toolbar.\n                                </paragraph><paragraph>This toolbar appears when you log in and enables you to publish, move,\n                                    replace or translate any kind of content.\n                                </paragraph><paragraph>The Online Editor is a WYSIWYG editor integrated into the website (no HTML\n                                    coding required), providing formatting functions similar to word processing\n                                    applications.\n                                </paragraph></section></section><section><section><header>Publish content from your favourite word processor</header><paragraph><embed align="center" view="embed-inline" size="original" custom:offset="0" custom:limit="5" object_id="109"/></paragraph><paragraph>Many content managers prefer working directly in Microsoft Word or Open\n                                    Office. The import / export feature enables you to create or edit site content in\n                                    your favorite word processor, even when you might not have Internet access.\n                                </paragraph><paragraph>Afterwards, you can upload the document through either a WebDAV client or the\n                                    front-end of your site to generate or update articles, documentation pages and so\n                                    on.\n                                </paragraph></section></section><section><section><header>Translate your content</header><paragraph><embed align="center" view="embed-inline" size="original" custom:offset="0" custom:limit="5" object_id="110"/></paragraph><paragraph>All content in eZ Publish can be translated to multiple languages. Having\n                                    only one website to administer is efficient and makes it easier to maintain a\n                                    consistent brand across languages and countries.\n                                </paragraph><paragraph>An international corporation or organization can have one website with\n                                    content in several languages. When a visitor selects a language, the menus and\n                                    content are displayed accordingly. If you have not yet translated specific content,\n                                    it will be shown in the source language or not at all (depending on your\n                                    configuration).\n                                </paragraph><paragraph>When you are editing content, you can choose to switch the language you are\n                                    currently editing or to translate from one language to another. Content in the\n                                    source language is shown when you are translating, to aid in the process. When\n                                    creating or updating content translations, you can also use the built-in content\n                                    &#x201C;diff&#x201D; functionality to see the added or removed text in the source language.\n                                </paragraph><paragraph>Multiple, multilingual URLs can be created for each page. By default, you can\n                                    have an object called "Easy" with a URL "/easy" but also create a French translation\n                                    with a URL "/facile".\n                                </paragraph></section></section><section><section><header>&amp;nbsp;Upload multiple files at once</header><paragraph><embed align="center" view="embed-inline" size="original" custom:offset="0" custom:limit="5" object_id="111"/></paragraph><paragraph>If you want to upload more than one document, picture or video at a time, eZ\n                                    Publish has multi-upload functionality.\n                                </paragraph><paragraph>You simply select the content you want from your computer or from the server\n                                    where your content is stored. eZ Publish can detect the type of content uploaded and\n                                    creates the appropriate web pages.\n                                </paragraph></section></section><section><section><header>Picture galleries</header><paragraph><embed align="center" view="embed-inline" size="original" custom:offset="0" custom:limit="5" object_id="112"/></paragraph><paragraph>eZ Publish makes it easy to create picture galleries. With the multi-upload\n                                    functionality, you can add many pictures at once, then eZ Publish will scale, format\n                                    and resize the pictures automatically.\n                                </paragraph><paragraph>You can then browse through the galleries and re-use images elsewhere in your\n                                    website.\n                                </paragraph></section></section><section><section><header>Video publishing</header><paragraph><embed align="center" view="embed-inline" size="original" custom:offset="0" custom:limit="5" object_id="113"/></paragraph><paragraph>Basically, a video is another type of content you or users of your website\n                                    can publish. You can use eZ Publish to store and display any video format for web TV\n                                    functionality or video publishing similar to Youtube.\n                                </paragraph></section></section><section><section><header>Web 2.0 features</header><paragraph><embed align="center" view="embed-inline" size="original" custom:offset="0" custom:limit="5" object_id="114"/></paragraph><paragraph>Tag clouds, blogs, forums and polls are all built-in eZ Publish features.\n                                    Make your users contribute and build communities.\n                                </paragraph></section></section><section><section><header>Search</header><paragraph><embed align="center" view="embed-inline" size="original" custom:offset="0" custom:limit="5" object_id="115"/></paragraph><paragraph>To find any content on your eZ Publish site, you can use the integrated\n                                    search engine in eZ Publish. To add more functionality and scale high-loaded\n                                    websites,\n                                    <link url_id="85">eZ Find</link>\n                                    is an enterprise search extension for eZ Publish.\n                                </paragraph></section></section></section>\n', 'ezxmltext', 586, 'fre-FR', 2, 0, '', 1),
