(0, 185, 117, 0, NULL, '<?xml version="1.0" encoding="utf-8"?>\n<ezauthor><authors><author id="0" name="Administrator User" email="bk@ez.no"/></authors></ezauthor>\n', 'ezauthor', 632, 'fre-FR', 2, 0, '', 1),
(0, 186, 117, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/"><section><paragraph>To provide you with full control over your website, eZ Publish has many features\n                                that make it easy to manage both content and users.\n                            </paragraph></section></section>', 'ezxmltext', 633, 'fre-FR', 2, 0, '', 1),
(0, 187, 117, 0, 1045487555, '<?xml version="1.0"?>\n<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/"><section><paragraph><ul><li><paragraph>Administration Interface</paragraph></li><li><paragraph>Permission and access control</paragraph></li><li><paragraph>Workflows</paragraph></li><li><paragraph>Versioning and modification tracking</paragraph></li><li><paragraph>A unique content model</paragraph></li><li><paragraph>Content cross publishing</paragraph></li><li><paragraph>Multi-site deployment</paragraph></li><li><paragraph>Search engine optimization</paragraph></li></ul></paragraph><section><header>A rich and powerful Administration Interface</header><paragraph><embed align="center" size="original" object_id="118"/></paragraph><paragraph>The content of a site can be displayed (and modified) in various ways. The\n                                    Administration Interface is the advanced back-end interface, providing powerful\n                                    tools for content management and editing as well as site management, configuration,\n                                    customization and development.\n                                </paragraph><paragraph>In other words, you can change almost everything about a site in the\n                                    Administration Interface.\n                                </paragraph><header>Permission, rights management and access control</header><paragraph><embed align="center" size="original" object_id="119"/></paragraph><paragraph>The eZ Publish access system is multi-level and role-based. This means that\n                                    you can give a user or a group of users access to a combination of functions across\n                                    the whole site or within a specific area of the site. For example, you restrict a\n                                    certain part of a site to community or partner members.\n                                </paragraph><header>Workflows</header><paragraph><embed align="center" size="original" object_id="120"/></paragraph><paragraph>eZ Publish comes with an integrated workflow mechanism. An example of this is\n                                    the built-in collaboration system, which defines an ordered sequence of actions to\n                                    be executed after a content editor has published an object.\n                                </paragraph><paragraph>Suppose that your site has a restriction that all content has to go through\n                                    an editor-in-chief before being published. It can be set as &#x201C;pending&#x201D; before being\n                                    approved to be published. On the other hand, if a pending version is rejected by the\n                                    editor, it can be set as &#x201C;rejected&#x201D;.\n                                </paragraph><paragraph>&amp;nbsp;Another example is the e-commerce engine, which can be used to\n                                    manage subscriptions on a media site, automating access for paid subscribers to read\n                                    premium news content, watch videos, and so on.\n                                </paragraph><header>Versioning and modification tracking</header><paragraph><embed align="center" size="original" object_id="121"/></paragraph><paragraph>Having access to older versions of content enables supervisors or\n                                    editors-in-chief to check for inconsistency or errors in the content. eZ Publish\n                                    automatically keeps track of which content changes were made by which users at what\n                                    time, and provides the option to revert content to a previous version.\n                                </paragraph><header>A unique content model</header><paragraph><embed align="center" size="original" object_id="122"/></paragraph><paragraph>Publishing content is no longer only about publishing articles. Depending on\n                                    your needs you must define specific content structures for cars, recipes, specific\n                                    products for your webshop and more. eZ Publish has a flexible content engine that\n                                    enables administrators to create these content definitions directly through\n                                    graphical user interfaces.\n                                </paragraph><header>Content cross publishing</header><paragraph><embed align="center" size="original" object_id="123"/></paragraph><paragraph>Using the cross publishing feature, you can re-use content throughout the\n                                    site while avoiding inconsistent duplicates of content that are hard to maintain. If\n                                    content appears at multiple locations, you only have to edit the object once &#x2013; the\n                                    changes will be reflected at all locations.\n                                </paragraph><header>Multi-site deployment</header><paragraph><embed align="center" size="original" object_id="124"/></paragraph><paragraph>One installation of eZ Publish can host many different websites with the\n                                    possibility to re-use content, functionality and design across the different sites.\n                                    You can have a continuous overview of all your sites and can even industrialize this\n                                    deployment via the Site Factory management service in\n                                    <link url_id="86">eZ Publish\n                                        Premium\n                                    </link>\n                                    subscription services.\n                                </paragraph><header>URL management and search engine optimization</header><paragraph><embed align="center" size="original" object_id="125"/></paragraph><paragraph>eZ Publish makes it easy for you to create content that will be effectively\n                                    indexed by search engines. Sitemaps, friendly URLs, and easy management of key XHTML\n                                    tags are all built-in features.\n                                </paragraph></section></section></section>\n', 'ezxmltext', 634, 'fre-FR', 2, 0, '', 1),
