(0, 268, 128, 0, NULL, '<?xml version="1.0" encoding="utf-8"?>\n<ezimage serial_number="1" is_valid="1" filename="graphics1.png" suffix="png" basename="graphics1" dirpath="var/ezwebin_site/storage/images/getting-started/how-to-develop-with-ez-publish/graphics12/692-1-fre-FR" url="var/ezwebin_site/storage/images/getting-started/how-to-develop-with-ez-publish/graphics12/692-1-fre-FR/graphics1.png" original_filename="ce010869.png" mime_type="image/png" width="540" height="411" alternative_text="" alias_key="1293033771" timestamp="1350735768"><original attribute_id="692" attribute_version="1" attribute_language="fre-FR"/></ezimage>\n', 'ezimage', 692, 'fre-FR', 2, 0, '', 1),
