(0, 183, 129, 0, NULL, 'Lots of Websites, One eZ Publish Installation', 'ezstring', 694, 'fre-FR', 2, 0, 'lots of websites, one ez publish installation', 1),
(0, 184, 129, 0, NULL, 'Adding Siteaccesses in eZ Publish', 'ezstring', 695, 'fre-FR', 2, 0, 'adding siteaccesses in ez publish', 1),
(0, 185, 129, 0, NULL, '<?xml version="1.0" encoding="utf-8"?>\n<ezauthor><authors><author id="0" name="Greg McAvoy-Jensen" email="admin@myportal.com"/></authors></ezauthor>\n', 'ezauthor', 696, 'fre-FR', 2, 0, '', 1),
(0, 186, 129, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>This tutorial gives developers the power to extend the features and flexibility of eZ\n                            Publish beyond a single website, to having an unlimited number in one installation. At the\n                            end of this tutorial you will have learned how to best leverage eZ Publish''s siteaccess\n                            concept to create multiple websites. It will let you apply this concept through the concrete\n                            case of building two different, multilingual websites on one single eZ Publish instance.\n                        </paragraph></section>', 'ezxmltext', 697, 'fre-FR', 2, 0, '', 1),
(0, 187, 129, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><section><header>Introduction</header><paragraph>Users of eZ Publish sometimes wonder if it is possible to make use of a single\n                                installation of eZ Publish for multiple websites. The answer is yes—through the power of\n                                the “siteaccess”. In fact, an understanding of siteaccesses gives one the ability to do\n                                much more than just host multiple sites in one installation. With this technique you\n                                can:\n                            </paragraph><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">make it\n                                            easier to share content between databases\n                                        </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">copy and\n                                            add locations to objects\n                                        </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">use a\n                                            single Premium agreement and one eZ Network extension for multiple sites\n                                            with the same or different content\n                                        </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">simplify eZ\n                                            Publish upgrades by consolidating several sites on one installation\n                                        </paragraph></li></ul></paragraph><paragraph>This is demo content, to continue real reading, please visit&amp;nbsp;\n                                <link target="_blank" url_id="94">\n                                    share.ez.no\n                                </link>\n                            </paragraph></section><section><header>About the author : Greg McAvoy-Jensen</header><paragraph>Greg is the executive director of&amp;nbsp;<link target="_blank" xhtml:title="Granite Horizon" url_id="95">\n                                Granite Horizon</link>, one of the largest eZ Publish development firms in the United\n                                States of America. A certified eZ Publish developer, he has served clients and trained\n                                developers on four continents since he started working with eZ Publish in 2003. His wife\n                                Heather and he are proud parents of three wonderful children.\n                            </paragraph></section></section>', 'ezxmltext', 698, 'fre-FR', 2, 0, '', 1),
