(0, 186, 136, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>Enterprise Web Content Management</paragraph></section>', 'ezxmltext', 776, 'fre-FR', 2, 0, '', 1),
(0, 187, 136, 0, 1045487555, '<?xml version="1.0"?>\n<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><table class="default" width="100%" border="0" custom:summary="paragraph" custom:caption=""><tr><td><paragraph>A global web content management system leader, eZ Systems was founded\n                                            in 1999 and has 10 offices worldwide. eZ Systems&#x2019; flagship product, eZ\n                                            Publish, is the leading enterprise Web Content Management (WCM) platform\n                                            specializing in multichannel content distribution for web, mobile, tablets,\n                                            print and more.\n                                        </paragraph><paragraph>Because eZ Publish is a commercial open source product, eZ Systems\n                                            engineers can leverage the innovation from a global community of over 38 000\n                                            developers and certified implementation partners. This innovation drives\n                                            over 200 000 worldwide installations, proving that eZ Publish is one of the\n                                            most adaptable, open and reliable WCM platforms in the market.\n                                        </paragraph></td><td><paragraph><embed align="center" view="embed-inline" size="listitem" custom:offset="0" custom:limit="5" object_id="137"/></paragraph></td></tr></table></paragraph><paragraph>The eZ Publish Enterprise Edition is the perfect blend of reliable vendor support and\n                            quality\n                        </paragraph><paragraph>assured innovation: enterprise customers pay a cost effective yearly subscription fee\n                            for support, maintenance, update training and other services, and eZ Systems releases major\n                            software updates every 6 months. All of this comes with no license fee.\n                        </paragraph><paragraph>With offices in Europe, the Nordics, the Americas and Asia, eZ Systems is a\n                            recognized global WCM leader in the media and publishing industry. This industry demands the\n                            most flexible, secure, maintainable and complex solutions to power large web properties and\n                            generate revenue from an array of content sources. With a track record spanning more than 10\n                            years in this space, eZ Publish has now become the software of choice for customers in\n                            banking and finance, retail, government and non- government organizations. If you have\n                            advanced publishing needs, eZ Publish is right for you.\n                        </paragraph><section><section><header>Multichannel Content Distribution</header><paragraph>eZ Publish delivers unsurpassed multichannel capabilities that enable\n                                    customers to reach out and engage your audience. eZ&#x2019;s out-of-the-box functionality,\n                                    intrinsic scalability and robust API help you to do this quickly, accelerating your\n                                    time to market while reducing your implementation costs.&amp;nbsp;\n                                </paragraph><paragraph><strong>&amp;nbsp;</strong></paragraph></section></section><section><section><header>Enabling Editors</header><paragraph>eZ Publish provides a rich tool set that makes authoring and editing content\n                                    simple and engaging. eZ Publish frees your editorial and creative staff to do what\n                                    they do best: publish content with enthusiasm and minimal effort.\n                                </paragraph><section><header>Plan, Review, Automate</header><paragraph>Publishing is one thing, but managing portals and front pages is a\n                                        different story. eZ Publish Enterprise has a unique portal management solution\n                                        that enables editors to build complex page layouts and plan, review and automate\n                                        the publication schedule to ensure a constant flow of rich content through\n                                        portal pages.\n                                    </paragraph><paragraph>For example, editors can define multiple &#x201C;zones&#x201D; within a single page\n                                        layout. Within each zone, editors create &#x201C;blocks&#x201D; that promote content in a\n                                        certain way. Next, editors explicitly or implicitly add content objects to these\n                                        blocks and then schedule\n                                    </paragraph><paragraph>the promotion, flow and rotation of content. To &#x201C;look into the future,&#x201D;\n                                        editors simply drag a slider across a timeline to preview content before it goes\n                                        live. This entire process can be managed without the support of a web developer.\n                                    </paragraph></section><section><header>Collaborate</header><paragraph>We know that editors do not work alone. eZ Publish provides flexible\n                                        workflow and collaboration tools and dashboards to keep your team in sync. And\n                                        you can configure the system to adapt to your own workflows, however intricate\n                                        they may be.\n                                    </paragraph></section></section></section><section><section><header>Adaptable Content Engine and User Interfaces</header><paragraph>eZ&#x2019;s unique, flexible content model completely separates content from\n                                    presentation, so that the delivery of your content can adapt to any current or\n                                    future distribution channel. Furthermore, you can design the system to fit your\n                                    needs&#x2014;your do not have to force your content into a &#x201C;one size fits all&#x201D; construct.\n                                    This structure sets your content free for re-use and re-purposing. This powerful\n                                    flexibility is the source of eZ&#x2019;s strength as multichannel content management\n                                    platform.\n                                </paragraph><paragraph>The system also adapts to your editors&#x2019; style of work. They can choose to\n                                    import content from multiple sources, utilize a simple editing toolbar while\n                                    browsing your site, or use the powerful back office editing suite. The efficient\n                                    user interfaces and flexibility flattens the learning curve and accelerates internal\n                                    adoption of eZ Publish.\n                                </paragraph></section></section><section><section><header>Open Enterprise Technology</header><paragraph>eZ Publish&#x2019;s open architecture supports Interoperability Open Standards like\n                                    XML, ODF, SOAP, REST, JSON. When you utilize the powerful API, it&#x2019;s simple to\n                                    integrate the eZ Enterprise platform with all of your information management\n                                    systems. In fact, there are over 1000 extensions available to accelerate your\n                                    project and reduce development costs.\n                                </paragraph></section></section><section><section><header>Reliable Vendor Support</header><paragraph>eZ Systems is dedicated to your success. We succeed only if you do. Our\n                                    customers benefit from our commercial support packages that are customized to meet\n                                    the nature of your project and service level agreements. Our highly qualified\n                                    product support engineers thrive on your complete satisfaction, and enjoy enabling\n                                    our partners and customers with accurate and thorough responses to support requests.\n                                </paragraph><paragraph>In addition to this unlimited product support, we provide a variety of expert\n                                    training and consulting services to certify and assist developers and implementation\n                                    partners around the globe. We host self-service tools like user and technical\n                                    documentation, forums, books, tutorials, articles and community sites to distribute\n                                    and share best practices. Our dedication to supporting our clients and partners is\n                                    the core service of eZ&#x2019;s Enterprise Open Source Business model.\n                                </paragraph></section></section><section><section><header>They trust in eZ</header><paragraph><embed view="embed-inline" size="large" custom:offset="0" custom:limit="5" object_id="138"/></paragraph></section></section></section>\n', 'ezxmltext', 777, 'fre-FR', 2, 0, '', 1),
