(0, 186, 176, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>While there are many Content Management Systems (CMS) in the market, very few do\n                            exactly what a CMS is supposed to do: achieve a clean separation between content and design.\n                        </paragraph></section>', 'ezxmltext', 1020, 'fre-FR', 2, 0, '', 1),
(0, 187, 176, 0, 1045487555, '<?xml version="1.0"?>\n<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><section><section><header>What is content and design?</header><paragraph>Content is information that is organized and stored in a structured manner by\n                                    <link url_id="101">eZ Publish</link>. For example, content may be\n                                    the components of a news article (such as the title, introduction, body, and images)\n                                    or the properties of a car (such as the model, year, and color).\n                                </paragraph><paragraph>All information that is stored for the purpose of later retrieval is referred\n                                    to as content. The presentation of content is determined by the design of a site.\n                                </paragraph><paragraph>While content refers to structured data, design refers to the way the data is\n                                    visually presented. Design includes the things that make up a web interface: HTML,\n                                    stylesheets (CSS), images that are not part of the content, typography, fonts, and\n                                    so on.\n                                </paragraph><paragraph>So, while content deals with storing and structuring data, design dictates\n                                    how the content should be presented.\n                                </paragraph><paragraph><embed size="original" view="embed" custom:offset="0" custom:limit="5" object_id="177"/></paragraph></section></section><section><section><header>Benefits of a Content Management System</header><paragraph>The ability to handle the distinction between structuring and displaying\n                                    content is one of the<link url_id="102">key features\n                                        of eZ Publish</link>. The separation of content and design provides the\n                                    following benefits:\n                                </paragraph><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Content\n                                                editors and designers can work separately without conflicts\n                                            </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Content\n                                                can be published easily in multiple formats\n                                            </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Content\n                                                can easily be transferred and re-purposed\n                                            </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Global\n                                                redesigns and changes can be applied with simple modifications\n                                            </paragraph></li></ul></paragraph></section></section><section><section><header>Presenting the content: templates</header><paragraph>Templates represent the fundamental unit of site design in eZ Publish. For\n                                    example, a template might dictate that a page should appear with the site''s title at\n                                    the top and with the main content in the middle. When the page is accessed, the\n                                    Content Management System places the content (the actual title and body text) into\n                                    the appropriate locations in the template.\n                                </paragraph><paragraph>An eZ Publish template is a custom, extended HTML file that describes how\n                                    particular types of content should be presented. For example, there is a template\n                                    for viewing a folder and its contents, a news article, the contents of a\n                                    <link anchor_name="picturegallery" url_id="103">gallery\n                                    </link>\n                                    as thumbnails,\n                                    <link anchor_name="videoplayer" url_id="104">media files\n                                    </link>\n                                    as list items,\n                                    <link anchor_name="visitorinteraction" url_id="105">forum posts\n                                    </link>\n                                    and so on.\n                                </paragraph><paragraph>In some cases, you can even have different article templates based on\n                                    different kinds of articles or where they are located in the content hierarchy. In\n                                    short, templates are the transforming unit that produces the site layout, either for\n                                    an entire webpage or some part of that page. The following screenshots illustrate\n                                    how different templates work together to produce a page.\n                                </paragraph><paragraph>Learn more in<link url_id="106">Developers section</link>.\n                                </paragraph></section></section></section>\n', 'ezxmltext', 1021, 'fre-FR', 2, 0, '', 1),
