(0, 185, 187, 0, NULL, '<?xml version="1.0" encoding="utf-8"?>\n<ezauthor><authors><author id="0" name="Administrator User" email="nospam@ez.no"/></authors></ezauthor>\n', 'ezauthor', 1079, 'fre-FR', 2, 0, '', 1),
(0, 186, 187, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>To provide you with full control over your website, eZ Publish has many features that\n                            make it easy to manage both content and users.\n                        </paragraph></section>', 'ezxmltext', 1080, 'fre-FR', 2, 0, '', 1),
(0, 187, 187, 0, 1045487555, '<?xml version="1.0"?>\n<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Administration\n                                        Interface\n                                    </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Permission and\n                                        access control\n                                    </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Workflows\n                                    </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Versioning and\n                                        modification tracking\n                                    </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">A unique\n                                        content model\n                                    </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Content cross\n                                        publishing\n                                    </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Multi-site\n                                        deployment\n                                    </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Search engine\n                                        optimization\n                                    </paragraph></li></ul></paragraph><section><section><header>A rich and powerful Administration Interface</header><paragraph><embed view="embed" size="original" custom:offset="0" custom:limit="5" object_id="195"/></paragraph><paragraph>The content of a site can be displayed (and modified) in various ways. The\n                                    Administration Interface is the advanced back-end interface, providing powerful\n                                    tools for content management and editing as well as site management, configuration,\n                                    customization and development.\n                                </paragraph><paragraph>In other words, you can change almost everything about a site in the\n                                    Administration Interface.\n                                </paragraph></section></section><section><section><header>Permission, rights management and access control</header><paragraph><embed view="embed" size="original" custom:offset="0" custom:limit="5" object_id="188"/></paragraph><paragraph>The eZ Publish access system is multi-level and role-based. This means that\n                                    you can give a user or a group of users access to a combination of functions across\n                                    the whole site or within a specific area of the site. For example, you restrict a\n                                    certain part of a site to community or partner members.\n                                </paragraph></section></section><section><section><header>Workflows</header><paragraph><embed view="embed" size="original" custom:offset="0" custom:limit="5" object_id="189"/></paragraph><paragraph>eZ Publish comes with an integrated workflow mechanism. An example of this is\n                                    the built-in collaboration system, which defines an ordered sequence of actions to\n                                    be executed after a content editor has published an object.\n                                </paragraph><paragraph>Suppose that your site has a restriction that all content has to go through\n                                    an editor-in-chief before being published. It can be set as &#x201C;pending&#x201D; before being\n                                    approved to be published. On the other hand, if a pending version is rejected by the\n                                    editor, it can be set as &#x201C;rejected&#x201D;.\n                                </paragraph><paragraph>&amp;nbsp;Another example is the e-commerce engine, which can be used to\n                                    manage subscriptions on a media site, automating access for paid subscribers to read\n                                    premium news content, watch videos, and so on.\n                                </paragraph></section></section><section><section><header>Versioning and modification tracking</header><paragraph><embed view="embed" size="original" custom:offset="0" custom:limit="5" object_id="190"/></paragraph><paragraph>Having access to older versions of content enables supervisors or\n                                    editors-in-chief to check for inconsistency or errors in the content. eZ Publish\n                                    automatically keeps track of which content changes were made by which users at what\n                                    time, and provides the option to revert content to a previous version.\n                                </paragraph></section></section><section><section><header>A unique content model</header><paragraph><embed view="embed" size="original" custom:offset="0" custom:limit="5" object_id="191"/></paragraph><paragraph>Publishing content is no longer only about publishing articles. Depending on\n                                    your needs you must define specific content structures for cars, recipes, specific\n                                    products for your webshop and more. eZ Publish has a flexible content engine that\n                                    enables administrators to create these content definitions directly through\n                                    graphical user interfaces.\n                                </paragraph></section></section><section><section><header>Content cross publishing</header><paragraph><embed view="embed" size="original" custom:offset="0" custom:limit="5" object_id="192"/></paragraph><paragraph>Using the cross publishing feature, you can re-use content throughout the\n                                    site while avoiding inconsistent duplicates of content that are hard to maintain. If\n                                    content appears at multiple locations, you only have to edit the object once &#x2013; the\n                                    changes will be reflected at all locations.\n                                </paragraph></section></section><section><section><header>Multi-site deployment</header><paragraph><embed view="embed" size="original" custom:offset="0" custom:limit="5" object_id="193"/></paragraph><paragraph>One installation of eZ Publish can host many different websites with the\n                                    possibility to re-use content, functionality and design across the different sites.\n                                    You can have a continuous overview of all your sites and can even industrialize this\n                                    deployment via the Site Factory management service in\n                                    <link url_id="86">eZ Publish Premium\n                                    </link>\n                                    subscription services.\n                                </paragraph></section></section><section><section><header>URL management and search engine optimization</header><paragraph><embed view="embed" size="original" custom:offset="0" custom:limit="5" object_id="194"/></paragraph><paragraph>eZ Publish makes it easy for you to create content that will be effectively\n                                    indexed by search engines. Sitemaps, friendly URLs, and easy management of key XHTML\n                                    tags are all built-in features.\n                                </paragraph></section></section></section>\n', 'ezxmltext', 1081, 'fre-FR', 2, 0, '', 1),
