(0, 185, 196, 0, NULL, '<?xml version="1.0" encoding="utf-8"?>\n<ezauthor><authors><author id="0" name="Administrator User" email="nospam@ez.no"/></authors></ezauthor>\n', 'ezauthor', 1123, 'fre-FR', 2, 0, '', 1),
(0, 186, 196, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>eZ Publish is more than a basic CMS, but a content management platform based on a\n                            clear API that allows developers to customize and extend eZ Publish.\n                        </paragraph></section>', 'ezxmltext', 1124, 'fre-FR', 2, 0, '', 1),
(0, 187, 196, 0, 1045487555, '<?xml version="1.0"?>\n<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link anchor_name="contentclass" url_id="107">The content class\n                                            concept\n                                        </link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link anchor_name="customdesign" url_id="107">Custom design: CSS\n                                            and templates\n                                        </link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link anchor_name="phpcomponents" url_id="107">High-quality library\n                                            of PHP components\n                                        </link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link anchor_name="buildextensions" url_id="107">Build eZ Publish\n                                            extensions\n                                        </link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link anchor_name="developmentenvironment" url_id="107">Which development\n                                            environment?\n                                        </link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link anchor_name="ezcommunity" url_id="107">eZ Publish community\n                                            and resources\n                                        </link></paragraph></li></ul></paragraph><section><section><header>The content class concept</header><paragraph><embed size="original" view="embed" custom:offset="0" custom:limit="5" object_id="197"/></paragraph><paragraph>Any piece of content in eZ Publish is a content object, which is an instance\n                                    of a specific content class. A content class is a definition of an arbitrary data\n                                    structure. It does not store any actual data.\n                                </paragraph><paragraph>A content class is made up of attributes. The characteristics of an attribute\n                                    are determined by the datatype that is chosen for that specific attribute. By\n                                    combining different datatypes, it is possible to represent complex data structures.\n                                </paragraph><paragraph>The illustration above shows the anatomy of a content class called "Article",\n                                    which defines a data structure for storing news articles. It consists of attributes\n                                    dedicated for storing the title, an introduction text and the actual body of an\n                                    article.\n                                </paragraph></section></section><section><section><header>Custom design: CSS and templates</header><paragraph><embed size="original" view="embed" custom:offset="0" custom:limit="5" object_id="198"/></paragraph><paragraph>The first thing you may be willing to do is to change the look of your eZ\n                                    Publish site. This can be done by modifying the CSS of eZ Publish and<link url_id="87">\n                                        overriding templates</link>. You can even create reusable\n                                    <link url_id="88">site packages</link>\n                                    that include these CSS and template changes.\n                                </paragraph></section></section><section><section><header>High-quality library of PHP components</header><paragraph>eZ Publish 4.X as well as the next generations of eZ Publish are based on\n                                    <link url_id="89">eZ Components</link>\n                                    which are a high quality library of independent components aiming to help developers\n                                    creating web centric applications like for example customising and extending eZ\n                                    Publish.\n                                </paragraph><paragraph>In the eZ Components you will find components that focus their attention on\n                                    solving important parts of Web application development. They are written for solving\n                                    the re-occurring issues that Web application developers have to deal with when\n                                    building their applications - without any superfluous ballast.\n                                </paragraph><paragraph>In order to cater for this goal, quality is also an important factor. The eZ\n                                    Components development team uses a test-driven development methodology where a large\n                                    effort is put into making the APIs easily testable. This also results in a better\n                                    API for developers to use.\n                                </paragraph></section></section><section><section><header>Build eZ Publish extensions</header><paragraph>There is a clear API to develop your own PHP extensions in order to extend\n                                    the functionality of eZ Publish. By using extensions it is possible to create new\n                                    modules, datatypes, template operators, workflow events , or any integration with\n                                    third party applications. You will find many contributed extensions available at\n                                    <link url_id="90">Contribution page</link>.\n                                </paragraph></section></section><section><section><header>Which development environment?</header><paragraph>In an eZ Publish project, a\n                                    <link target="_blank" url_id="91">Subversion (SVN)</link>\n                                    repository is usually set up to track all changes during development projects. When\n                                    it comes to IDE, both\n                                    <link target="_blank" url_id="92">Eclipse</link>\n                                    and\n                                    <link target="_blank" url_id="93">PHPEdit</link>\n                                    have been optimised for eZ Publish.\n                                </paragraph></section></section><section><section><header>eZ Publish community and resources</header><paragraph>When you start developing with eZ Publish, the community is definitely an\n                                    environment to get in touch with. You will find your answers or get help in the\n                                    forums as well as many contributions that will make save you time in your\n                                    development projects.\n                                </paragraph></section></section></section>\n', 'ezxmltext', 1125, 'fre-FR', 2, 0, '', 1),
