(0, 186, 199, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>New RESTful interface, which will allow external client implementations, to access\n                            and query content resources inside an eZ Publish installation\n                        </paragraph></section>', 'ezxmltext', 1144, 'fre-FR', 2, 0, '', 1),
(0, 187, 199, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>Different aspects of the content objects can be queried at will, such as metadata or\n                            actual values. The REST interface is protected either by OAuth 2.0 or HTTP Basic\n                            authentication\n                        </paragraph></section>', 'ezxmltext', 1145, 'fre-FR', 2, 0, '', 1),
