(0, 185, 201, 0, NULL, '<?xml version="1.0" encoding="utf-8"?>\n<ezauthor><authors><author id="0" name="Administrator User" email="bk@ez.no"/></authors></ezauthor>\n', 'ezauthor', 1167, 'fre-FR', 2, 0, '', 1),
(0, 186, 201, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>eZ Publish 4.5 supports a canonical link feature that helps search engines to figure\n                            out duplicate content issues and allow them to index relevant content.\n                        </paragraph></section>', 'ezxmltext', 1168, 'fre-FR', 2, 0, '', 1),
(0, 187, 201, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>- For simple siteaccesses, like nor, fre,, ger, eng the feature works out of the box\n                            &amp;nbsp;\n                        </paragraph><paragraph>- More complex mappings require a manual configuration in the file</paragraph><paragraph>- You use the canonical link to tell the search engines which url is the preferred\n                            one when you have several duplicate url’s.\n                        </paragraph><paragraph>Example of duplicate url’s:</paragraph><paragraph>-&amp;nbsp;\n                            <link target="_self" url_id="108">www.example.com</link>\n                        </paragraph><paragraph>- example.com</paragraph><paragraph>-&amp;nbsp;\n                            <link target="_self" url_id="109">www.example.com/index.html\n                            </link>\n                        </paragraph><paragraph>- example.com/home.asp</paragraph><paragraph>Example of canonical link:</paragraph><paragraph>&lt;link rel="canonical" href="<link target="_self" url_id="108">\n                            http://www.example.com</link>/" /&gt;\n                        </paragraph></section>', 'ezxmltext', 1169, 'fre-FR', 2, 0, '', 1),
