(0, 187, 203, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>What is FastCGI?</paragraph><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Like CGI,\n                                        FastCGI is also language-independent. For instance, FastCGI provides a way to\n                                        improve the performance of the thousands of Perl applications that have been\n                                        written for the Web.\n                                    </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Like CGI,\n                                        FastCGI runs applications in processes isolated from the core Web server, which\n                                        provides greater security than APIs. (APIs link application code into the core\n                                        Web server, which means that a bug in one API-based application can corrupt\n                                        another application or the core server; a malicious API-based application can,\n                                        for example, steal key security secrets from another application or the core\n                                        server.)\n                                    </paragraph></li></ul></paragraph><paragraph>Read more&amp;nbsp;http://www.fastcgi.com/</paragraph></section>', 'ezxmltext', 1193, 'fre-FR', 2, 0, '', 1),
